import React from 'react'
import Karavanlar1 from './Components/Karavanlar1';
import Karavanlar2 from './Components/Karavanlar2';
import { karavanlar } from './karavandata';
import Zoom from 'react-reveal/Zoom';
import { Parallax, ParallaxBanner, ParallaxBannerLayer } from 'react-scroll-parallax';
import Navbar from './Components/Navbar';

function App() {
  return (
    <div className='w-[100%]'>

      <Navbar />

      <ParallaxBanner style={{ aspectRatio: '1 / 1' }}>
        <ParallaxBannerLayer speed={-30} className='d-flex align-items-center justify-content-center'>
          <img src={karavanlar[2]} className="w-100 h-100" style={{objectFit:'cover'}} />
        </ParallaxBannerLayer>
        <ParallaxBannerLayer className='w-100 text-white h-100 d-flex align-items-center justify-content-center'>
          <h1>My Headline</h1>
        </ParallaxBannerLayer>
      </ParallaxBanner>

      <div className='w-100 bg-white'>
        {karavanlar.map(karavan => {
          return <Karavanlar1 karavanImage={karavan} />
        })}
      </div>
    </div>
  );
}

export default App;
